import React from "react";
import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
import Footer from "../components/Footer2";
import Company from "../components/Company";

const Home = () => {
  return (
    <div>
      <Navbar />
      <Hero />
      <Company />
      <Footer />
    </div>
  );
};

export default Home;
